import LocalSource from "@/datasource/controller";

async function shopLoginFromLocalSource(data) {
  return LocalSource.shopLogin(data)
}
async function shopLogin(data) {
  return await shopLoginFromLocalSource(data);
}




async function getAllVirusesFromLocalSource() {
  return LocalSource.getAllViruses()
}
async function getAllViruses() {
  return await getAllVirusesFromLocalSource()
}




async function getAllOrderFromClientFromLocalSource(id) {
  return LocalSource.getAllOrderFromClient(id)
}
async function getAllOrderFromClient(id) {
  return await getAllOrderFromClientFromLocalSource(id);
}




export default {
  shopLogin,
  getAllViruses,
  getAllOrderFromClient
}
